    false,nt"url": null,nt"notes": "This EnviroAtlas dataset describes the
    percentage of different land cover types within 15- and 50-meters of hydrologically
    connected streams, rivers, and other water bodies within the Atlas Area. This dataset
    was produced by the US EPA to support research and online mapping activities related
    to EnviroAtlas. EnviroAtlas (http:/www.epa.gov/enviroatlas) allows the user to interact
    with a web-based, easy-to-use, mapping application to view and analyze multiple
    ecosystem services for the contiguous United States. The dataset is available as
    downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas
    map service. Additional descriptive information about each attribute in this dataset
    can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
